import React, { Component } from "react";
import { Collapse, Card } from "antd";
import ChecklistAccordionSub from "./ChecklistAccordionSub";

const ChecklistAccordion = (props1) => {
  return (
    <Collapse defaultActiveKey="1">
      {Object.entries(props1.v).map(([next_k, next_v]) => {
        return (
          <ChecklistAccordionSub
            title2={next_k}
            title={props1.title1}
            questions={next_v}
            globalDispatch={props1.globalDispatch}
          />
        );
      })}
    </Collapse>
  );
};

export default ChecklistAccordion;
